description:
I denna historia om fyra vanner som avreste fran &quot;the Midlands&quot; i september
2001 for ett oskyldigt brollop och semester i Pakistan. Tva och ett halvt ar
senare har bara tre av dem atervant hem. Genom deras epos om resan, hor
vi deras historia om missforstand, okunnighet, beslut och vanskap som ledde
dem fran deras sakra tillvaro som smastadstonaringar till en tillvaro i mitten
av &quot;kriget mot terrorn&quot;...
